      SELECT DISTINCT + + ( - col0 ) * - col1 * + col1 + + cor0.col0 * col1 * ( - cor0.col0 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q4310.out
    data: |
      -34560
      -69680
      1794
